Director    Jenna Jameson 
Starring    Barrett Blade, Jesse Capelli, Ben English, Manuel Ferrera, Melissa Lauren, McKenzie Lee, Marco, Ashton Moore, Scott Nails, Sophia Rossi, Chanel St. James, Krystal Steal, Evan Stone 



 Description  

--------------------------------------------------------------------------------


Anal. DPs. Gonzo style sex in a feature style film!

In an unprecedented move, Jenna\&amp;#039;s Provocateur will be released with 6 different covers, focusing on one of the Club Jenna Girls. Each special edition 2-disc DVD set includes an exclusive souvenir booklet, Club Jenna Girl commentary and bonus footage of it\&amp;#039;s covergirl, as well as bonus Behind The Scenes footage starring Jenna herself!

Jenna Jameson has entered a realm where the lines between fantasy and reality are blurred. That realm has materialized on film in her directorial debut, with Jenna\&amp;#039;s depraved fantasies played out by her contract stars.

Each scene takes it\&amp;#039;s star to the brink of her sexuality and tests their limits...It is beauty unrivaled.
